import React from "react";

const Match = (props) =>{
    // let x= props.x;
    // let y= props.y;
    // let z= props.z;
    let {x,y,z}=props;

    return(
        <>
        <div className="slot_inner">
        <h1>{x} {y} {z}</h1>
        <h1>this is matching</h1>
        </div>
        <hr/>
        </>
    )

}
export default Match;
